import logo from './logo.svg';
import './App.css';

import CoinData from './MOCK_DATA.json';

function App() {
  return (
    <div className="App">
        ...search youir coin...
      <br /><br />
      {
        CoinData.map( coin => {
          return(
            <div className='box'>
              <image src={ coin.image } className='CoinImage' height={250} width={250} /> <br />
              <img src={coin.image !== 'N/A' ? coin.image : 'http://via.placeholder.com/400'} alt={coin.token_name}/>
              { coin.token_name } <br />
              { coin.token_price } <br />
              { coin.created_time } <br />
            </div>
          )
        }
        )
      }
    </div>
  );
}

export default App;
